import React from 'react';

import Navigation from './Navigation/Navigation';

import Logo from '../../logo_transparent.png';


const Header = () => (
    <div className="header">
        <img src={Logo} alt="logo" className="logo"/>
        <Navigation/>
    </div>
);

export default Header
